import React from "react";
import './header.css';
import {Nav,Navbar,Container, Form} from 'react-bootstrap';
import {Routes,Route,Link} from 'react-router-dom';
import Home from "../home/Home";
import Drink from "../Drink/Drink"
import Gallery from "../gallery/Gallery";
import {Search} from 'react-bootstrap-icons';
const Header = () => {
  return (
    <>
    <div className="main-container">
      <Navbar expand="lg" >
      <Container>
        <Navbar.Brand as={Link} to="/home" style={{fontSize:"25px"}}>Drink-App</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto" style={{fontSize:"25px"}}>
            <Nav.Link as={Link} to="/home">Home</Nav.Link>
            <Nav.Link as={Link} to="/drinks">Drinks</Nav.Link>
            <Nav.Link as={Link} to="/gallery">Gallery</Nav.Link>
          </Nav>
          <Form>
            <input type="text" placeholder="Search" style={{width:"200px"}}></input>
            <button style={{bord}}type="submit" id="searchSubmit"><Search/></button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    </div>
    <div>
      <Routes>
        <Route path="/home" element={<Home/>}></Route>
        <Route path="/drinks" element={<Drink/>}></Route>
        <Route path="/gallery" element={<Gallery/>}></Route>
      </Routes>
    </div>
    </>
  );
};

export default Header;
